import React from "react";
import styled from "styled-components";

const Container = styled.div`
  margin: 3rem auto;
  text-align: center;
`;
const ProfessorsDetail = props => {
  return (
    <Container>
      {props.data.map(profData => (
        <p>{profData.name}</p>
      ))}
    </Container>
  );
};
export default ProfessorsDetail;
